import React, { Component } from "react";
import "./PhoneProducts.css";
import Image from "./mobile.jpg";
import { NavLink } from "react-router-dom";

class PhoenProducts extends Component {
  state = {
    productsPhone: [],
    phone: []
  };

  async componentDidMount() {
    try {
      const response = await fetch("http://localhost:8000/products");
      const result = await response.json();
      if (result) {
        const productsPhone = result.data;
        this.setState({ productsPhone });
        console.log(this.state.productsPhone);
      } else console.log(result.message);
    } catch (err) {
      console.log(err);
    }
  }

  render() {
    const theProductsPhone = productsPhone.map(product => {
      return (
        <div className="card-phone">
          <div className="card_phone">
            {/* Card image */}
            <img className="card-img-top" src={Image} alt="Card image cap" />
            {/* Card content */}
            <div className="card-body">
              {/* Title */}
              <h4 className="card-title">
                <p>Card title</p>
              </h4>
              {/* Text */}
              <p className="card-text">
                Some quick example text to build on the card title and make up
                the bulk of the card's content.
              </p>
              <NavLink to="details" className="btn btn-danger">
                Show Details
              </NavLink>
            </div>
          </div>
        </div>
      );
    });
  }
}

export default PhoenProducts;
